It is necessary for the succesfull of this use case to have a Planar Graph Layout where there is a clear identification of the machines, which are in the Convex Hull of this Layout. Those machines in the Convex Hull Layout must own an input and output devices. The other machines out of the Convex Hull Layout shall not have those devices. All machines are linked together in this Planar Graph G.

Input devices must have only out-links;
Output devices must have only in-links.

This use case needs the following use cases, which have all information described above:

1 - Use Case Maintain Products;
2 - Use Case Maintain List of Attributes;
3 - Use Case Maintain Layout for the Machines.
